    <style>
        body {
            display: flex;
            align-items: center;
            margin: 20px;
            flex-direction: column;
        }
        #app {
            width: 1000px;
        }
        #main-title-div {
            display: flex;
            justify-content: center;
            height: 2rem;
        }
        #main-title-div > *{
            display: block;
        }
        .main-block {
            box-shadow: 0px 0px 3px 3px #CCC;
            border-radius: 5px;
            background-color: azure;
            margin: 20px 0px;
        }
        .main-block > * {
            padding: 5px;
        }
        .main-block > .title-div {
            padding: 5px 5px 5px 20px;
            border-radius: 5px 5px 0px 0px;
            font-size: 150%;
            font-weight: bold;
            background-color: #CFF;
        }
        .title-div {
            display: flex;
            align-items: center;
        }
        #dropdowns-div {
            display: flex;
            flex-direction: row;
            flex-wrap: wrap;
        }
        #dropdowns-div .dropdown-item {
            text-align: right;
        }
        .one-dropdown-div {
            display: flex;
            flex-direction: row;
            color: brown;
            width: 33.3%;
            padding: 3px;
        }
        .one-dropdown-div > .title-div {
            width: 40%;
        }
        .one-dropdown-div > .btn-group {
            width: 60%;
        }
        .dropdown-toggle {
            display: flex;
            justify-content: flex-end;
            align-items: center;
        }
        .dropdown-toggle > .caret {
            margin: 0px 5px 0px 0px;
        }
        .results-div {
            display: flex;
            flex-direction: column;
        }
        .one-results-div {
            display: flex;
            flex-direction: row;
            flex-wrap: wrap;
            padding: 0px;
        }
        .one-result-div {
            display: flex;
            flex-direction: row;
            justify-content: space-between;
            padding: 0px 5px;
            width: 25%;
        }
        .one-result-div.borderline {
            border-bottom: 1px solid #6FF;
        }
        .one-result-div.one-result-1 {
            background: #9FF;
        }
        .data-div {
            display: flex;
            align-items: center;
            padding: 0px 0px 0px 10px;
            font-family: Consolas, "Liberation Mono", Courier, monospace;
        }
        .color-COLORBOLD.color-level-5, .color-COLORBOLD.color-level-1 {
            font-weight: bold;
        }
        .color-level-1, .color-level-2 {
            color: red;
        }
        .color-level-4, .color-level-5 {
            color: green;
        }
        .color-NO {
            color: black;
        }
        .hide-button, .show-button {
            width: 20px;
            height: 20px;
            margin: 4px 10px 0px 0px;
            border: 2px solid black;
            cursor: pointer;
        }
        .hide-button {
            background-image: url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABAAAAAQCAYAAAAf8/9hAAAAL0lEQVQ4T2P8////fwYKAOOoAQyDKAwYGRlJikxY7MO9QLEBJFmPpHgQBeII9gIAveRF0QK/W4IAAAAASUVORK5CYII=");
        }
        .show-button {
            background-image: url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABAAAAAQCAYAAAAf8/9hAAAAO0lEQVQ4T2P8////fwYKACNNDWBkZAS7DZ8j8bpgpBkA8y+xMQoLWHggUmwANptHWizQJAyIiVKKcyMADWdj0VQTTDUAAAAASUVORK5CYII=");
        }
        #main-description-button, #sr-description-button {
            font-size: 1rem;
            padding: 0.2rem 0.5rem;

        }
        .modal-dialog {
            max-width: 800px;
        }
        #main-description-div, #sr-description-div {
            display: flex;
            flex-direction: row;
            justify-content: flex-end;
        }
    </style>
</head>

<body>
    <div id="app">
        <div id="main-title-div">
            <h1 id="MAIN-TITLE-text"></h1>
        </div>
        <div id="main-description-div">
            <button id="main-description-button" class="btn btn-secondary btn-lg" data-toggle="modal" data-target="#main-description-modal">{{ description.MAIN[0] }}</button>
        </div>
        <div class="modal fade" id="main-description-modal" tabindex="-1" role="dialog" aria-labelledby="main-description-label" aria-hidden="true">
            <div class="modal-dialog">
                <div class="modal-content">
                    <div class="modal-header">
                        <h4 class="modal-title" id="main-description-label">{{ description.MAIN[0] }}</h4>
                        <button type="button" class="close" data-dismiss="modal" aria-hidden="true">&times;</button>
                    </div>
                    <div class="modal-body">
                        <span v-for="line in description.MAIN.slice(2)" v-html="(line[line.length - 1] != '>' ? '&emsp;&emsp;' : '') + line + '<br/>'"></span>
                    </div>
                </div><!-- /.modal-content -->
            </div><!-- /.modal -->
        </div>
        <div class="main-block">
            <div class="title-div">
                <span id="OPTIONS-TITLE-text"></span>
            </div>
            <div id="dropdowns-div">
                <custom-dropdown
                    v-for="dropdown in dropdowns"
                    :title="dropdown.title"
                    :list="dropdown.list"
                    :chosenindex.sync="dropdown.index"
                    :click="dropdown.click"
                >
            </div>
        </div>
        <results-div
            v-for="resultgroup in resultGroups"
            :resultgroup="resultgroup.item"
            :resulttitle="resultgroup.title"
            :mode="mode"
            :colormode="colormode"
            :precision="precision"
            :ishide.sync="resultgroup.ishide"
        >
        </results-div>
        <div id="sr-description-div">
            <button id="sr-description-button" class="btn btn-secondary btn-lg" data-toggle="modal" data-target="#sr-description-modal">{{ description.SR[0] }}</button>
        </div>
        <div class="modal fade" id="sr-description-modal" tabindex="-1" role="dialog" aria-labelledby="sr-description-label" aria-hidden="true">
            <div class="modal-dialog">
                <div class="modal-content">
                    <div class="modal-header">
                        <h4 class="modal-title" id="sr-description-label">{{ description.SR[0] }}</h4>
                        <button type="button" class="close" data-dismiss="modal" aria-hidden="true">&times;</button>
                    </div>
                    <div class="modal-body">
                        <span v-for="line in description.SR.slice(2)" v-html="(line[line.length - 1] != '>' ? '&emsp;&emsp;' : '') + line + '<br/>'"></span>
                    </div>
                </div><!-- /.modal-content -->
            </div><!-- /.modal -->
        </div>
    </div>

ROOM1":"铜之间","MAJSOULROOM2":"银之间","MAJSOULROOM3":"金之间","MAJSOULROOM4":"玉之间","MAJSOULROOM5":"王座之间","MAJSOULSTABLERANKCOMMENT":"说明：某个房间的安定段位对应能进入该房间的最低级头衔，如金之间-雀杰。\n特别的，由于目前没人打王座，雀圣1星即为雀豪4星，以此类推。安定段位即安定星数。\n在result.html中可以获得更详细的数据和说明。"},"WEB":{"DESCRIPTION":{"MAIN":["关于本页面的说明","","该页面通过PaipuAnalyzer自动生成，仅用作数据展示，没有数据分析功能。需要重新分析数据请重新运行PaipuAnalyzer。","除了展示分析数据，页面提供了将分析数据和天凤的凤桌数据、天凤位数据进行简单对比的功能。","根据数据差距（人为简单划分的差距范围）来对数据使用不同颜色突出显示，绿色数据较优，红色数据较劣，黑色数据相似或无法比较。","天凤数据为2018年12月31日之前的所有牌谱分析得到。","","<b>本页面中可进行的操作：</b>","1.调整显示选项。","2.对于不同的数据分类，可以点击其左上角的-号方块进行隐藏。","3.将鼠标移到单项数据上悬停会显示分析数据，比较数据及差距等详细数据信息。","","<b>显示选项内容说明：</b>","<b>语言：</b>选择语言。","<b>基础数据来源：</b>选择和东风场，南风场还是全部数据进行比较。","<b>基础数据ID：</b>选择和谁的数据进行比较。全部凤桌统计了所有牌谱每个玩家的数据。全部天凤位统计了天凤位的数据。其余为在位的14位天凤的个人数据。需要注意部分天凤位基本没有打东场，部分数据可能没有参考价值。","<b>数据展示方式：</b>可以展示分析数据，也可展示与比较数据之差。","<b>染色方式：</b>可以选择染色+加粗；染色；不染色。","<b>数据精度：</b>选择数据保留的小数位数，可以选择2,4,6。"],"SR":["关于安定段位的说明","","<b>安定段位：</b>","安定段位即雀魂安定称号星数，根据牌谱分析结果计算出的当你在某个房间无限对局最终会稳定在的称号星数。","由于天凤安定段位和雀魂安定星数不具有可比性，故暂时未计算天凤数据的安定段位。","由于初心时四位不掉分，以及铜场只有初心，因此铜场不能计算安定星数。","不同场的安定星数即对应该场所对应的最低头衔的星级。如金之间安定星数4.5即安定雀杰4.5星。","接上例，当安定星数大于3时，经过若干场次就会升段。由于升段后会改变掉分比例以及开放高一级房间，因此并不能直接换算雀杰4.5星=雀豪1.5星。同理，当安定段位小于1时，在大量对局后会表现为掉星。","","<b>置信区间：</b>","置信区间表示了安定段位的可信程度。简单来说，置信区间越小说明计算场次越多，估计的安定星数越准确。","详细了解置信区间需要概率论和统计的基础数学知识，如果没有基础知识可以忽略以下内容。","本程序计算的置信区间为0.95置信区间。使用正态分布进行估计，在盘数小于100时由于分布的离散性很不准确。","程序所采用的公式在盘数大于1000时和随机采样结果进行比较结果相近因此采用，其数学原理没有依据。如果有擅长此方面的大佬存在欢迎指正。","<b>相关Issue：</b><a href=\"https://github.com/zyr17/MajsoulPaipuAnalyzer/issues/4\">Github Issue</a>","<b>程序的安定段位和置信区间计算说明：</b><a href=\"https://github.com/zyr17/MajsoulPaipuAnalyzer/blob/master/doc/stable-rank.md\">stable-rank.md</a>"]},"TITLE":{"MAIN":"结果","OPTIONS":"显示选项"},"DROPDOWNS":{"TITLE":{"LANGUAGES":"语言","BASEDATAROUND":"基础数据来源","BASEDATAID":"基础数据ID","DATASHOW":"数据展示方式","COLORED":"染色方式","PRECISION":"数据精度"},"LANGUAGES":{"zh-CN":"简体中文","en-US":"英文","zh-TW":"繁体中文"},"BASEDATAROUND":{"EAST":"东风战","SOUTH":"南风战","ALL":"全部"},"BASEDATAID":{"ALLHOUOU ,"AKA":"赤寶牌"},"MISC":{"WORDNOTEXIST":"要查找的詞匯不在詞表中！","ERROR":"錯誤：","DASH":"-----","ENTEREXIT":"按 Enter 鍵退出程序...","COLON":"：","COMMA":"，","ROUND4GAME":"東風局","ROUND8GAME":"南風局","MAJSOULROOM0":"友人場","MAJSOULROOM1":"銅之間","MAJSOULROOM2":"銀之間","MAJSOULROOM3":"金之間","MAJSOULROOM4":"玉之間","MAJSOULROOM5":"王座之間","MAJSOULSTABLERANKCOMMENT":"說明：某個房間的安定段位對應能進入該房間的最低級頭銜，如金之間-雀傑。\n特別的，由於目前沒人打王座，雀聖1星即為雀豪4星，以此類推。安定段位即安定星數。\n在result.html中可以獲得更詳細的數據和說明。"},"WEB":{"DESCRIPTION":{"MAIN":["關於本頁面的說明","","該頁面通過PaipuAnalyzer自動生成，僅用作數據展示，沒有數據分析功能。需要重新分析數據請重新運行PaipuAnalyzer。","除了展示分析數據，頁面提供了將分析數據和天鳳的鳳桌數據、天鳳位數據進行簡單對比的功能。","根據數據差距（人為簡單劃分的差距範圍）來對數據使用不同顏色突出顯示，綠色數據較優，紅色數據較劣，黑色數據相似或無法比較。","天鳳數據為2018年12月31日之前的所有牌譜分析得到。","","<b>本頁面中可進行的操作：</b>","1.調整顯示選項。","2.對於不同的數據分類，可以點擊其左上角的-號方塊進行隱藏。","3.將鼠標移到單項數據上懸停會顯示分析數據，比較數據及差距等詳細數據信息。","","<b>顯示選項內容說明：</b>","<b>語言：</b>選擇語言。","<b>基礎數據來源：</b>選擇和東風場，南風場還是全部數據進行比較。","<b>基礎數據ID：</b>選擇和誰的數據進行比較。全部鳳桌統計了所有牌譜每個玩家的數據。全部天鳳位統計了天鳳位的數據。其餘為在位的14位天鳳的個人數據。需要注意部分天鳳位基本沒有打東場，部分數據可能沒有參考價值。","<b>數據展示方式：</b>可以展示分析數據，也可展示與比較數據之差。","<b>染色方式：</b>可以選擇染色+加粗；染色；不染色。","<b>數據精度：</b>選擇數據保留的小數位數，可以選擇2,4,6。"],"SR":["關於安定段位的說明","","<b>安定段位：</b>","安定段位即雀魂安定稱號星數，根據牌譜分析結果計算出的當你在某個房間無限對局最終會穩定在的稱號星數。","由於天鳳安定段位和雀魂安定星數不具有可比性，故暫時未計算天鳳數據的安定段位。","由於初心時四位不掉分，以及銅場只有初心，因此銅場不能計算安定星數。","不同場的安定星數即對應該場所對應的最低頭銜的星級。如金之間安定星數4.5即安定雀傑4.5星。","接上例，當安定星數大於3時，經過若干場次就會升段。由於升段後會改變掉分比例以及開放高一級房間，因此並不能直接換算雀傑4.5星=雀豪1.5星。同理，當安定段位小於1時，在大量對局後會表現為掉星。","","<b>置信區間：</b>","置信區間表示了安定段位的可信程度。簡單來說，置信區間越小說明計算場次越多，估計的安定星數越準確。","詳細了解置信區間需要概率論和統計的基礎數學知識，如果沒有基礎知識可以忽略以下內容。","本程序計算的置信區間為0.95置信區間。使用正態分布進行估計，在盤數小於100時由於分布的離散性很不準確。","程序所採用的公式在盤數大於1000時和隨機採樣結果進行比較結果相近因此採用，其數學原理沒有依據。如果有擅長此方面的大佬存在歡迎指正。","<b>相關Issue：</b><a href=\"https://github.com/zyr17/MajsoulPaipuAnalyzer/issues/4\">Github Issue</a>","<b>程序的安定段位和置信區間計算說明：</b><a href=\"https://github.com/zyr17/MajsoulPaipuAnalyzer/blob/master/doc/stable-rank.md\">stable-rank.md</a>"]},"TITLE":{"MAIN":"結果","OPTIONS":"顯示選項"},"DROPDOWNS":{"TITLE":{"LANGUAGES":"語言","BASEDATAROUND":"基礎數據來源","BASEDATAID" h, 2018.","","<b>Options Can be Done in This Page:</b>","1.Change display options.","2.For every data blocks, you can hide it by clicking \"-\" on left-top.","3.Hover on a data will show detail datas.","","<b>About Display Options:</b>","<b>Language: </b>Choose a language.","<b>Base data source: </b>Choose east, south, or all data wto compare.","<b>Base data ID: </b>Choose whose data to compare. All Houou Player analyzed all players' data, All Tenhou analyzed all Tenhous' data, Others are Tenhous. Note that because some Tenhous seldom play east, some data may not useful.","<b>Data Display: </b>Can show analyzed data or delta of base data.","<b>Color Way: </b>Show data in colored and bold, or colord, or without color.","<b>Data Precision: </b>The precision when showing data."],"SR":["About Stable Rank","","<b>Stable Rank: </b>","Stable rank is stable stars in Mahjongsoul, which is calculated by analyzed paipus, and means the title and stars you will stay when you take unlimited matches.","Because we can't compare Tenhou's stable rank with Mahjongsoul, it is temporary no stable rank data for Tenhous.","Because when you are Novice won't have last place penalty, and only Novice can play Bronze Room, so we can't calculate stable stars in Bronze Room.","Different stable stars in different room corresponding to the latter title to enter this room. e.g. stable stars 4.5 in Gold Room means Expert 4.5.","About Expert 4.5, when stable stars bigger than 3, with enough matches you will upgrade your title. For upgrading title will change the penalty step and open new rooms, we can't cimply say Expert 4.5 = Master 1.5. For same reason, when stable ranks is less than 1, you will fall with enough matches.","","<b>Confidence Interval: </b>","For confidence interval, in simple, the more matches analyzed, the smaller the confidence interval, and the stable stars is more accurate. alpha=0.05","The procedure when calculating confidence interval may having many mistakes, if you are good a var languages_list = Object.keys(I18N);

var dropdown_functions = {
    LANGUAGES: function (index) {
        use_language = languages_list[index];
        app.description = I18N[use_language].WEB.DESCRIPTION;
        updateDropdowns();
        updateMainTitles();
        updateResultGroups();
    },
    BASEDATAROUND: function (index) {
        use_round = dropdowns[1].list_s[index];
        updateDropdowns();
        updateResultGroups();
    },
    BASEDATAID: function (index) {
        use_id = dropdowns[2].list_s[index];
        updateResultGroups();
    },
    DATASHOW: function (index) {
        app.mode = dropdowns[3].list_s[index];
    },
    COLORED: function (index) {
        app.colormode = dropdowns[4].list_s[index];
    },
    PRECISION: function (index) {
        app.precision = dropdowns[5].list_s[index];
    }
}

var dropdowns = [
    {title: 'LANGUAGES', list: JSON.parse(JSON.stringify(languages_list)), click: dropdown_functions.LANGUAGES},
    {title: 'BASEDATAROUND', list: ['ALL', 'EAST', 'SOUTH'], click: dropdown_functions.BASEDATAROUND},
    {title: 'BASEDATAID', list: ['AAA'], click: dropdown_functions.BASEDATAID},
    {title: 'DATASHOW', list: ['ORIGINAL', 'DELTA'], click: dropdown_functions.DATASHOW},
    {title: 'COLORED', list: ['COLORBOLD', 'COLOR', 'NO'], click: dropdown_functions.COLORED},
    {title: 'PRECISION', list: [6, 4, 2], click: dropdown_functions.PRECISION}
];

//设置目前使用的语言
var use_language = 'zh-CN';
var use_language_index = 0;
for (let i = 0; i < languages_list.length; i ++ )
    if (languages_list[i] == use_language)
        use_language_index = i;
var use_round = 'ALL';
var use_id = '';
var use_colon = ': ';

//移动title和list，初始化index
for (let i = 0; i < dropdowns.length; i ++ ){
    dropdowns[i].title_s = dropdowns[i].title;
    dropdowns[i].list_s = JSON.parse(JSON.stringify(dropdowns[i].list));
    dropdowns[i].index = i == 0 ? use_language_index : 0;
}

function updateMainTitles(){
    let ids = Object.keys(I18N[use_language].WEB.TITLE);
    $('title').text(I18N[use_language].WEB.TITLE.MAIN)
    for (let i = 0; i < ids.length; i ++ )
        $('#' + ids[i] + '-TITLE-text').text(I18N[use_language].WEB.TITLE[ids[i]]);
}

function updateDropdowns(){
    for (let i = 0; i < dropdowns.length; i ++ ){
        dropdowns[i].title = I18N[use_language].WEB.DROPDOWNS.TITLE[dropdowns[i].title_s];
        dropdowns[i].list.length = 0;
        if (dropdowns[i].title_s == 'BASEDATAID'){
            let roundname = 'ALL';
            for (let j = 0; j < dropdowns.length; j ++ )
                if (dropdowns[j].title_s == 'BASEDATAROUND')
                    roundname = dropdowns[j].list_s[dropdowns[j].index];
            let ids = Object.keys(BASEDATA[roundname]);
            dropdowns[i].list_s = ids;
            for (let j = 0; j < ids.length; j ++ )
                dropdowns[i].list.push(ids[j] == 'ALLHOUOU' || ids[j] == 'ALLTENHOU' ? I18N[use_language].WEB.DROPDOWNS.BASEDATAID[ids[j]] : ids[j]);
            use_id = ids[0];
            dropdowns[i].index = 0;
            continue;
        }
        else for (let j = 0; j < dropdowns[i].list_s.length; j ++ )
            if (dropdowns[i].title_s != 'PRECISION')
                dropdowns[i].list.push(I18N[use_language].WEB.DROPDOWNS[dropdowns[i].title_s][dropdowns[i].list_s[j]] + (dropdowns[i].title_s == 'LANGUAGES' ? '(' + dropdowns[i].list_s[j] + ')' : ''));
            else
                dropdowns[i].list.push(dropdowns[i].list_s[j]);
    }
}

//生成resultGroups
var resultGroups = [];
var default_compare = undefined;
for (let i = 0, kk = Object.keys(RESULTCOMPARE); i < kk.length; i ++ )
    for (let j = 0; j < RESULTCOMPARE[kk[i]].length; j ++ )
        if (RESULTCOMPARE[kk[i]][j] == 'DEFAULT')
            default_compare = kk[i];
for (let i = 0; i < RESULTGROUP.order.length; i ++ ){
    let key = RESULTGROUP.order[i];
    if (key == 'HULEYAKURESULT' || key == 'CHONGYAKURESULT'){
        RESULTGROUP.data[key] = Object.keys(I18N[use_language].YAKU);
        for (let i = 0; i < RESULTGROUP.data[key].length; i ++ )
            if (RESULTGROUP.data[key][i] == 'RENHOU')
                RESULTGROUP.data[key].splice(i, 1);
    }
    //console.log(key, RESULTGROUP.data[key]);
    let rg = { title_s: key, item: [], ishide: false };
    rg.item.length = RESULTGROUP.data[key].length;
    let row = 4;
    let col = parseInt((rg.item.length - 1) / row + 1), add1 = (rg.item.length - 1) % row + 1;
    for (let j = 0; j < RESULTGROUP.data[key].length; j ++ ){
        let comparestr = default_compare;
        for (let ci = 0, kk = Object.keys(RESULTCOMPARE); ci < kk.length; ci ++ )
            for (let cj = 0; cj < RESULTCOMPARE[kk[ci]].length; cj ++ )
                if (RESULTCOMPARE[kk[ci]][cj] == (key == 'HULEYAKURESULT' ? 'HULEYAKU_' : key == 'CHONGYAKURESULT' ? 'CHONGLEYAKU_' : '') + RESULTGROUP.data[key][j])
                    comparestr = kk[ci];
        rg.item[j < add1 * col ? (parseInt(j / col) + j % col * row) : (parseInt((j - add1 * col) / (col - 1)) + (j - add1 * col) % (col - 1) * row + add1)] = 
            {
                title_s: RESULTGROUP.data[key][j],
                title: '',
                data: key == 'HULEYAKURESULT' || key == 'CHONGYAKURESULT' ? DATA[key == 'HULEYAKURESULT' ? 'HULEYAKU' : 'CHONGLEYAKU'][RESULTGROUP.data[key][j]] : DATA[RESULTGROUP.data[key][j]],
                comparestr,
                basedata: 0
            };
    }
    resultGroups.push(rg);
}

function updateResultGroups(){
    use_colon = I18N[use_language].MISC.COLON;
    for (let i = 0; i < resultGroups.length; i ++ ){
        let rg = resultGroups[i];
        rg.title = I18N[use_language].ANALYZER[rg.title_s];
        for (let j = 0; j < rg.item.length; j ++ ){
            let isyaku = rg.title_s == 'HULEYAKURESULT' || rg.title_s == 'CHONGYAKURESULT';
            let one = rg.item[j];
            one.title = I18N[use_language][isyaku ? 'YAKU' : 'ADRESULT'][one.title_s];
            if (one.title == undefined)
                one.title = I18N[use_language].ADRESULT[one.title_s.slice(0, one.title_s.length - 1) + '!'];
            if (one.title == undefined)
                one.title = I18N[use_language].ADRESULT[one.title_s + '!'];
            one.basedata = isyaku ? BASEDATA[use_round][use_id][rg.title_s == 'HULEYAKURESULT' ? 'HULEYAKU' : 'CHONGLEYAKU'][one.title_s] : BASEDATA[use_round][use_id][one.title_s];
        }
    }
}

updateMainTitles();
updateDropdowns();
updateResultGroups();

Vue.component('custom-dropdown', {
    props: ['title', 'list', 'chosenindex', 'click'],
    methods: {
        aClick: function(e) {
            var a = e.currentTarget;
            var index = parseInt($(a).attr('index'));
            this.$emit('update:chosenindex', index);
            this.click(index);
        }
    },
    template: `
    <div class="one-dropdown-div">
        <div class="title-div">
            <span class="buttontitle">{{ title }}</span>
        </div>
        <div class="btn-group">
            <button type="button" class="btn btn-outline-secondary dropdown-toggle" data-toggle="dropdown"><span>{{ chosenindex == undefined ? list[0] : list[chosenindex] }}</span> <span class="caret"></span></button>
            <div class="dropdown-menu" role="menu">
                <a class="dropdown-item" v-for="(text, index) in list" href="javascript:void(0)" :index="index" @click="aClick($event)">{{ text }}</a>
            </div>
        </div>
    </div>
    `
});

Vue.component('one-result', {
    props: ['title', 'basedata', 'data', 'mode', 'colormode', 'colorlevel', 'precision', 'index', 'maxlength'],
    methods: {
        generateTitle: function () {
            let res = this.title + use_colon + '\n';
            res += I18N[use_language].WEB.RESULTS.BASEDATA + use_colon + (this.basedata == '-' ? '-' : this.basedata.toFixed(this.precision)) + '\n';
            res += I18N[use_language].WEB.RESULTS.DATA + use_colon + (this.data == '-' ? '-' : this.data.toFixed(this.precision)) + '\n';
            res += I18N[use_language].WEB.RESULTS.DELTA + use_colon + (this.data == '-' || this.basedata == '-' ? '-' : (this.data > this.basedata ? '+' : '') + (this.data - this.basedata).toFixed(this.precision));
            return res;
        }
    },
    template: `
    <div :class="'one-result-div one-result-' + index % 2 + (index < parseInt((maxlength - 1) / 4) * 4 ? ' borderline' : '')" :title="generateTitle()" :style="index % 4 == 3 && index + 1 == maxlength ? 'border-radius: 0px 0px 5px 0px;' : ''">
        <div class="title-div">
            <span class="one-result-title">{{ title }}</span>
        </div>
        <div :class="'data-div color-' + colormode + ' color-level-' + colorlevel">
            <span class="one-result-data">{{ (data == '-' || mode == 'DELTA' && basedata == '-') ? '-' : (mode == 'DELTA' && data > basedata ? '+' : '') + ((mode == 'ORIGINAL' ? data : data - basedata).toFixed(precision)) }}</span>
        </div>
    </div>
    `
});

Vue.component('results-div', {
    props: ['resultgroup', 'resulttitle', 'mode', 'colormode', 'precision', 'ishide'],
    methods: {
        getColorlevel: function (oneres) {
            let data = oneres.data, basedata = oneres.basedata;
            if (data == '-' || basedata == '-' || data == basedata) return 3;
            let mm = basedata == 0 ? 100 * data / Math.abs(data) : data / basedata;
            let dd = data - basedata;
            if (oneres.comparestr == undefined) console.log(oneres);
            if (oneres.comparestr == 'N') return 3;
            let carr = oneres.comparestr.split(',');
            let biggood = oneres.comparestr[0] == 'B';
            let usedata = oneres.comparestr[1] == 'M' ? mm : dd;
            carr[0] = -1e100;
            for (let i = 0; i < carr.length; i ++ )
                carr[i] = parseFloat(carr[i]);
            carr.push(1e100);
            for (let i = 0; i < carr.length; i ++ )
                if (carr[i] > usedata)
                    return biggood ? i : 6 - i;
            console.log("???", oneres);
        },
        resultTitleClick: function() {
            this.$emit('update:ishide', !this.ishide);
        }
    },
    template: `
        <div class="results-div main-block">
            <div class="title-div" :style="'border-radius: 5px' + (ishide ? '' : ' 5px 0px 0px')">
                <div :class="ishide ? 'show-button' : 'hide-button'" :ishide="ishide" @click="resultTitleClick()"></div>
                <span class="results-title">{{ resulttitle }}</span>
            </div>
            <div class="one-results-div" v-if="!ishide">
                <one-result
                    v-for="(oneres, index) in resultgroup"
                    :title="oneres.title"
                    :basedata="oneres.basedata"
                    :data="oneres.data"
                    :mode="mode"
                    :colormode="colormode"
                    :colorlevel="getColorlevel(oneres)"
                    :precision="precision"
                    :index="index"
                    :maxlength="resultgroup.length"
                >
                </one-result>
            </div>
        </div>
    `
});

var app = new Vue({
    el: '#app',
    data: {
        dropdowns,
        resultGroups,
        mode: 'ORIGINAL',
        precision: 6,
        colormode: 'COLORBOLD',
        description: I18N[use_language].WEB.DESCRIPTION
    }
});

    </script>
</body>

</html>
